import React from 'react';

const Navbar: React.FC = () => {
  return (
    <nav className="h-[60px] px-4 md:px-6 lg:px-8">
      <div className="max-w-[1600px] mx-auto h-full">
        <div className="flex items-center justify-between h-full">
          {/* Logo */}
          <div className="flex items-center">
            <img src="/logo.png" alt="Logo" className="h-8" />
          </div>

          {/* Navigation Links */}
          <div className="hidden md:flex items-center space-x-8">
            <a href="#" className="text-base text-gray-700 hover:text-gray-900">Jobs</a>
            <a href="#" className="text-base text-gray-700 hover:text-gray-900">Career Compass</a>
            <a href="#" className="text-base text-gray-700 hover:text-gray-900">Contests</a>
            <a href="#" className="text-base text-gray-700 hover:text-gray-900">Degree</a>
          </div>

          {/* Profile */}
          <div className="flex items-center">
            <button className="flex items-center space-x-2 rounded-full hover:bg-gray-100 p-2">
              <div className="w-8 h-8 rounded-full bg-gray-800 flex items-center justify-center">
                <span className="text-white text-sm">P</span>
              </div>
              <svg className="w-5 h-5 text-gray-600" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
              </svg>
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
